// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TaxiRide {
    // State variables
    address public rider; // Sender
    address payable public driver; // Receiver
    uint public rideCost;
    bool public rideCompleted;

    // Events
    event RideStarted(address indexed rider, address indexed driver, uint rideCost);
    event RideCompleted(address indexed rider, address indexed driver, uint rideCost);

    // Constructor to initialize the rider, driver, and ride cost
    constructor(address _driver, uint _rideCost) {
        rider = msg.sender; // Rider is the contract deployer
        driver = payable(_driver);
        rideCost = _rideCost;
        rideCompleted = false;
    }

    // Function to start the ride
    function startRide() external {
        require(msg.sender == rider, "Only the rider can start the ride.");
        require(address(this).balance >= rideCost, "Insufficient balance for the ride.");
        
        emit RideStarted(rider, driver, rideCost);
    }

    // Function to complete the ride and transfer payment
    function completeRide() external {
        require(msg.sender == rider, "Only the rider can complete the ride.");
        require(!rideCompleted, "Ride has already been completed.");

        // Mark ride as completed
        rideCompleted = true;

        // Transfer the payment to the driver
        driver.transfer(rideCost);

        emit RideCompleted(rider, driver, rideCost);
    }

    // Function to fund the contract with the ride cost
    function fundRide() external payable {
        require(msg.sender == rider, "Only the rider can fund the ride.");
        require(msg.value == rideCost, "Incorrect amount sent.");
    }
}

